import React from "react";

function Selector() {
    return (
        <select name="select">
            <option value="value1">Radon</option>
            <option value="value2">Multi-parametro</option>
            <option value="value3">BC-Magee</option>
            <option value="value4">BS-MAAP</option>
            <option value="value5">Radiometro</option>
            <option value="value6">MP-Grimm</option>
        </select>
    )
}

export default Selector;
